import "./footer.css";
import { NavLink } from "react-router-dom";

function Footer() {
  return (
    <footer className="footer">
        <div className="container">
            <div class="flex">
                <NavLink className="nav-link" to="/about">
                    About
                </NavLink>
            </div>
                <p class="copyright">
                    Copyright &copy; SDSU Mechatronics 2022
                </p>
        </div>
    </footer>
  );
}

export default Footer;
